class Solution:
    def findCommonString(self,s,size):
        dic ={}
        for i in range(0,len(s)-size+1):
            if s[i:i+size] in dic.keys():
                self.ans = s[i:i+size]
                return True
            else:
                dic[s[i:i+size]] = 0
        return False
    def longestDupSubstring(self, s: str) -> str:
        self.ans = ""

        i = 0
        j = len(s)
        while i < j:
            mid = (i + j) // 2
            if self.findCommonString(s,mid):
                i = mid+1
            else:
                j = mid-1
        print(self.ans)
inp = ""
Solution().longestDupSubstring(inp)